import React from 'react'

const Challenge = () => {
    const date = new Date();
    console.log(date)
    return (
        <div>
            <p>today's date is: {date.to()} </p>
            <p>time is:{date.getHours()}:{date.getMinutes()}:{date.getSeconds()} </p>
        </div>
    )
}

export default Challenge;
